    return (
        <>
            <Typography type="captionsemibold" className={classes.amenitiesTitle}>
        Inclu√≠do no quarto
            </Typography>
            <div className={classes.amenities}>
                <Amenities amenities={amenities} amenitiesToShow={4} />
                <Typography type="body2semibold" className={classes.amenitiesInfo}>
          +{amenities.length - 4} comodidades
                </Typography>
            </div>
        </>
    );
};

Room.propTypes = {
    classes: PropTypes.object.isRequired,
    amenities: PropTypes.array.isRequired,
};

export default withStyles(styles, { withTheme: true })(Room);
